// Or -1 if none are found
export function getRandomNullOrEmptyTokenIndex(arr) {
  var randomIndex = Math.floor(Math.random() * arr.length);

  var i = randomIndex;
  while (true) {
    console.log(arr[i])
    if (arr[i] == null || arr[i] == {} || !arr[i].image_uri) {
      return i;
    } else {
      // move forward or wrap around
      if (i < arr.length-1) {
        i++;
      } else {
        i = 0;
      }
    }
    // fully wrapped around, no nulls are found
    if (i == randomIndex) {
      return -1;
    }
  }

  return i;
}

export const parseBalance = (
  value: BigNumberish,
  decimals = 18,
  decimalsToDisplay = 3
) => parseFloat(formatUnits(value, decimals)).toFixed(decimalsToDisplay);
